// src/pages/ServicosPage.js
import React from 'react';

const ServicosPage = () => (
  <div className="servicos-page">
    <h1>Serviços Brasfi</h1>
    <ul className="servicos-list">
      <li>Gestão de Sinistros</li>
      <li>Emissão de Apólices</li>
      <li>Cadastro de Contribuintes</li>
      <li>Gerenciamento de Seguros</li>
      <li>Relatórios e Dashboards</li>
      <li>Suporte e Monitoramento 24/7</li>
    </ul>
  </div>
);

export default ServicosPage;
